(4831, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:"title";s:38:"10 Web Design Trends To Expect in 2022";s:7:"excerpt";s:236:"2021 was a crazy year to say the least. Let’s pause for a moment to wrap things up and see what the future holds by taking a sneak peek into next year’s top design fads. We’ve selected upcoming 10 trends to spark your imagination.";s:7:"created";i:1640049600;s:5:"badge";s:0:"";s:3:"url";s:117:"https://elementor.com/blog/web-design-trends/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed";}i:1;a:5:{s:5:"title";s:35:"Elementor Websites of November 2021";s:7:"excerpt";s:292:"Helping us close out the year is a monthly showpiece that demonstrates many of web creation’s finest trends and leading design innovations. It’s time to heat up your beverage of creative ideas and get cozy with these ten delightful websites to round off our last monthly showcase of 2021.";s:7:"created";i:1639996273;s:5:"badge";s:0:"";s:3:"url";s:122:"https://elementor.com/blog/showcase-november-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed";}i:2;a:5:{s:5:"title";s:46:"Welcoming 25 New Page Templates to the Library";s:7:"excerpt";s:272:"The New Year calls for new beginnings and fresh starts, so we did a little refreshing too. The Library just got 25 new Template Pages to replace some of the older ones. They’re modern, sleek, and everything you’ll be looking for when it’s time to work on new pages. ";s:7:"created";i:1639379750;s:5:"badge";s:0:"";s:3:"url";s:130:"https://elementor.com/blog/new-page-templates-december-21/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed";}i:3;a:5:{s:5:"title";s:78:"How I Increased My Project Pricing From $3K to $20K+ Using Value-Based Pricing";s:7:"excerpt";s:269:"We all know that increasing your project pricing can be a challenge for most web creators. In this article, our community expert, Wil Brown, shares personal insights about value-based pricing and how he used this strategy to scale his project pricing to the 20K+ arena.";s:7:"created";i:1639045633;s:5:"badge";s:0:"";s:3:"url";s:128:"https://elementor.com/blog/how-increase-project-pricing/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed";}i:4;a:5:{s:5:"title";s:41:"End-of-Year Showcase 2021: Have Your Say!";s:7:"excerpt";s:215:"For our year-end website showpiece, we’re calling on you to help us select the top 10 Elementor websites of the year, narrowed down from our competitive pool of over 100 click-worthy nominees to a shortlist of 30.";s:7:"created";i:1638956991;s:5:"badge";s:0:"";s:3:"url";s:125:"https://elementor.com/blog/end-of-year-showcase-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed";}}', 'no'),
