(2222, 119, '_yoast_wpseo_metadesc', 'Bắp hoa bò là phần cơ nhỏ, nằm bên trong bắp chân trước của con bò. Thịt bắp hoa có màng gân bao quanh, màu đỏ sẫm, là phần cơ vận động nhiều nhất của bò'),
(2223, 119, '_yoast_wpseo_content_score', '90'),
(2224, 119, '_yoast_wpseo_estimated-reading-time-minutes', ''),
