(2240, 109, '_heateor_sss_meta', 'a:2:{s:7:"sharing";i:0;s:16:"vertical_sharing";i:0;}'),
(2241, 109, '_yoast_wpseo_title', 'Gà nguyên con | thực phẩm giá sỉ miền quê'),
(2242, 109, '_yoast_wpseo_metadesc', 'Thịt gà nguyên con được lấy từ Gà chạy bộ nuôi thả tự nhiên, tươi ngon, gà được thả tự nhiên tại miền quê, thoáng mát, mọi khâu từ tuyển chọn nguyên liệu ...'),
(2243, 109, '_yoast_wpseo_content_score', '90'),
(2244, 109, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
(2245, 107, '_heateor_sss_meta', 'a:2:{s:7:"sharing";i:0;s:16:"vertical_sharing";i:0;}'),
(2246, 107, '_yoast_wpseo_title', 'Má đùi gà | thực phẩm giá sỉ miền quê'),
(2247, 107, '_yoast_wpseo_metadesc', 'Má đùi gà là phần thịt tiếp giáp giữa thân gà và đùi gà tỏi. Thịt tại má đùi gà cũng có màu sậm và chắc như đùi gà tỏi. Đây là phần thịt rất ngon mà giá lại phải chăng.'),
(2248, 107, '_yoast_wpseo_content_score', '60'),
(2249, 107, '_yoast_wpseo_estimated-reading-time-minutes', '2'),
(2250, 104, '_heateor_sss_meta', 'a:2:{s:7:"sharing";i:0;s:16:"vertical_sharing";i:0;}'),
(2251, 104, '_yoast_wpseo_title', 'Đùi gà góc tư | thực phẩm giá sỉ miền quê'),
(2252, 104, '_yoast_wpseo_metadesc', 'Đùi gà góc tư là phần đùi gà gắn liền với một phần hông con gà, ước chừng thể tích như ¼ của nguyên con vậy. Phần thịt này rất nhiều protein.'),
(2253, 104, '_yoast_wpseo_content_score', '90'),
(2254, 104, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
(2255, 102, '_heateor_sss_meta', 'a:2:{s:7:"sharing";i:0;s:16:"vertical_sharing";i:0;}'),
(2256, 102, '_yoast_wpseo_title', 'Đùi gà | thực phẩm giá sỉ miền quê'),
(2257, 102, '_yoast_wpseo_metadesc', 'Đùi gà chứa nhiều chất dinh dưỡng có lợi cho sức khỏe. Đây là loại thực phẩm chứa nhiều vitamin như vitamin A, B1, B2, C, E, axit, canxi, photpho, sắt.. Cơ thể con người dễ hấp thu và tiêu hóa.'),
(2258, 102, '_yoast_wpseo_content_score', '90'),
(2259, 102, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
(2260, 100, '_heateor_sss_meta', 'a:2:{s:7:"sharing";i:0;s:16:"vertical_sharing";i:0;}'),
