(2262, 100, '_yoast_wpseo_metadesc', 'Trong cánh gà chứa nhiều chất dinh dưỡng như vitamin E, vitamin A, vitamin B, protein, lipit, phốt pho, sắt rất cần thiết cho sự phát triển của cơ thể đặc biệt..'),
(2263, 100, '_yoast_wpseo_content_score', '90'),
(2264, 100, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
