(2291, 86, '_yoast_wpseo_title', 'Bắp giò heo | thực phẩm giá sỉ miền quê'),
(2292, 86, '_yoast_wpseo_metadesc', 'Bắp giò heo là phần thịt nằm ở phía trên gối heo đến sát đùi heo. Phần thịt này không nhiều da và gân như chân giò heo, nhưng thịt của bắp giò heo khá là mềm.'),
