(2307, 44, '_yoast_wpseo_title', 'Rau muống | thực phẩm giá sỉ miền quê'),
(2308, 44, '_yoast_wpseo_metadesc', 'Rau muống chứa nhiều dinh dưỡng thiết yếu như vitamin A, C và beta-carotene. Chúng đóng vai trò quan trọng, giúp làm giảm các gốc tự do, chống oxy hóa.'),
(2309, 44, '_yoast_wpseo_content_score', '60'),
(2310, 44, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
