(2312, 42, '_yoast_wpseo_title', 'Mồng tơi | thực phẩm giá sỉ miền quê'),
(2313, 42, '_yoast_wpseo_metadesc', 'Trong rau mồng tơi có các chất như: Vitamin C, A, PP, B1, B2; Pectin; Saponin; Polysaccharide; Tinh bột; Chất đạm và béo; canxi; Sắt; Nước và Folate rất tốt cho cơ thể con người và giàu dinh dưỡng.'),
(2314, 42, '_yoast_wpseo_content_score', '60'),
(2315, 42, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
