(2317, 39, '_yoast_wpseo_title', 'Khổ qua | thực phẩm giá sỉ miền quê'),
(2318, 39, '_yoast_wpseo_metadesc', 'Trái khổ qua giàu vitamin C, A, E và B, đặc biệt là vitamin B2 và B9. Không những vậy, khổ qua còn có các loại khoáng chất như kali, sắt, ...'),
(2319, 39, '_yoast_wpseo_content_score', '60'),
(2320, 39, '_yoast_wpseo_estimated-reading-time-minutes', '1'),
