(2323, 37, '_yoast_wpseo_title', 'Khoai tây | thực phẩm giá sỉ miền quê'),
(2324, 37, '_yoast_wpseo_metadesc', 'Khoai tây chứa nhiều tinh bột, cellulose, giàu vitamin B1, B2, phốt pho. Riêng khoai tây nấu chín cung cấp hàm lượng vitamin C khá cao. Đối với sức khỏe.'),
(2325, 37, '_yoast_wpseo_content_score', '60'),
