(2336, 33, '_yoast_wpseo_metadesc', 'Trong cải thảo, hàm lượng các chất chống oxy hóa như vitamin C, A, B, K, hợp chất canxi,… khá cao. Đặc biệt là vitamin C góp phần quan trọng tạo chất đề kháng'),
