(17, 1, '2021-11-09 09:44:44', '2021-11-09 02:44:44', '<strong>Trứng gà</strong> là một loại thực phẩm có giá trị dinh dưỡng cao giàu protein, trong lòng đỏ trứng có chứa một hàm lượng phong phú lecithin và các vitaminA, D, B2. Protein của trứng gà là loại aminoacid cần thiết cho cơ thể, tỷ lệ phù hợp nên dễ hấp thu, có thể hấp thu trên 94%.\r\n\r\n&nbsp;', 'Trứng gà (1 vỉ)', 'This is a simple product.', 'publish', 'open', 'closed', '', 'hoodie-with-logo', '', '', '2021-12-22 16:12:42', '2021-12-22 09:12:42', '', 0, 'http://www.thucphamgiasimienque.com/san-pham/hoodie-with-logo/', 0, 'product', '', 0),
