(19, 1, '2021-11-09 10:52:06', '2021-11-09 03:52:06', 'Trong 1 quả trứng vịt (khoảng 70gr) có chứa 130 <strong>calo </strong>và những thành phần dinh dưỡng như:\r\n<ul>\r\n 	<li>Chất đạm: 18% DV (Giá trị dinh dưỡng hằng ngày)</li>\r\n 	<li>Cholesterol: 295% DV</li>\r\n 	<li>Chất béo: 14gr</li>\r\n 	<li>Vitamin A: 9% DV</li>\r\n 	<li>Vitamin B1: 7% DV</li>\r\n 	<li>Vitamin B2: 17% DV</li>\r\n 	<li>Vitamin B5: 13% DV</li>\r\n 	<li>Vitamin B9: 14% DV</li>\r\n 	<li>Vitamin B12: 63% DV</li>\r\n 	<li>Vitamin E: 5% DV</li>\r\n</ul>\r\nNgoài ra, trứng vịt còn cung cấp các loại khoáng chất dồi dào và phong phú như: Sắt, kẽm, choline, photpho,...\r\n\r\n<a title="Nguồn tham khảo từ bài viết Trứng vịt có tác dụng gì? Ăn nhiều trứng vịt có tốt không? khám phá ngay trên trang NGONAZ" href="https://ngonaz.com/trung-vit-co-tac-dung-gi/"><img src="https://ngonaz.com/wp-content/uploads/2021/10/ngonaz-1.jpg" /></a>', 'Trứng vịt (1 vỉ)', '', 'publish', 'open', 'closed', '', 'trung-vit', '', '', '2021-12-22 16:12:35', '2021-12-22 09:12:35', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=19', 0, 'product', '', 0),
