(22, 1, '2021-11-09 10:53:40', '2021-11-09 03:53:40', '<strong>Trứng cút</strong> là thực phẩm không chỉ bổ dưỡng mà còn có thể chế biến được nhiều món ăn hấp dẫn. Không chỉ dừng lại ở việc luộc, chiên, kho…, trứng cút còn có thể biến tấu hay kết hợp với các nguyên liệu khác.', 'Trứng cút (1 vỉ)', '', 'publish', 'open', 'closed', '', 'trung-cut', '', '', '2021-12-22 16:12:28', '2021-12-22 09:12:28', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=22', 0, 'product', '', 0),
