(25, 1, '2021-11-09 10:55:44', '2021-11-09 03:55:44', '<strong>Bí đỏ</strong> có hàm lượng dinh dưỡng cao nhưng lại chứa không quá nhiều calo. Trung bình 1kg bí đỏ chỉ có chứa khoảng 40 calo, vì vậy bí đỏ là là thực phẩm không thể thiếu trong thực đơn của những người muốn giảm cân.', 'Bí đỏ (1kg)', '', 'publish', 'open', 'closed', '', 'bi-do', '', '', '2021-12-22 16:12:11', '2021-12-22 09:12:11', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=25', 0, 'product', '', 0),
