(27, 1, '2021-11-09 10:56:26', '2021-11-09 03:56:26', '<div>\r\n<div class="rich-text">\r\n\r\n<strong>Cà rốt</strong> là một loại rau củ tốt cho sức khỏe, với độ giòn, vị ngon và chứa rất nhiều beta carotene, chất xơ, vitamin K1, kali cũng như chất chống oxy hóa. Ăn cà rốt rất thích hợp cho việc giảm cân, giúp giảm cholesterol, cải thiện sức khỏe mắt, thậm chí là giảm nguy cơ ung thư.\r\n\r\n</div>\r\n</div>', 'Cà rốt (1kg)', '', 'publish', 'open', 'closed', '', 'ca-rot', '', '', '2021-12-22 16:12:03', '2021-12-22 09:12:03', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=27', 0, 'product', '', 0),
