(31, 1, '2021-11-09 10:58:50', '2021-11-09 03:58:50', 'Chắc hẳn bạn đã biết đến cải ngọt - một loại rau đa công dụng trong cuộc sống như làm thức ăn, dùng làm thuốc,...Cải ngọt <b>khi ăn có vị ngọt thanh</b> hơn các loại cải khác, <b>khi già thì cay và nồng</b>. Cải ngọt có thể chế biến thành nhiều món ăn khác nhau như cải xào thịt bò, canh cải, cải luộc chấm nước mắm...Giống như những loại rau khác, cải ngọt không chỉ ngon miệng mà còn có nhiều công dụng tốt cho sức khỏe.', 'Cải ngọt (1kg)', '', 'publish', 'open', 'closed', '', 'cai-ngot', '', '', '2021-12-22 16:11:39', '2021-12-22 09:11:39', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=31', 0, 'product', '', 0),
