(33, 1, '2021-11-09 10:59:46', '2021-11-09 03:59:46', '<strong>Cải thảo</strong> có nguồn gốc từ Trung Quốc, còn gọi là cải bao, cải cuốn, cải bắp tây, là một loài thuộc họ Cải rất được yêu thích và được chế biến thành vô số những món xào, món canh và nhúng trong các <a title="món lẩu" href="https://www.dienmayxanh.com/vao-bep/mon-lau" target="_blank" rel="noopener">món lẩu</a> vô cùng thơm ngon. Cải thảo có màu sắc khá giống với bắp cải, phần lá bao ngoài của màu xanh đậm, còn lá cuộn ở bên trong (gọi là lá non) có màu xanh nhạt, trong khi phần cuống lá có màu trắng.', 'Cải thảo (1kg)', '', 'publish', 'open', 'closed', '', 'cai-thao', '', '', '2021-12-22 16:11:25', '2021-12-22 09:11:25', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=33', 0, 'product', '', 0),
