(35, 1, '2021-11-09 11:16:30', '2021-11-09 04:16:30', '<div class="short-description">Được trồng khá nhiều ở nước ta, đây là một loại rau củ rất ngon, gần như là quen thuộc trong tất cả bữa ăn ở mọi gia đình. <strong>Dưa leo</strong> chứa rất nhiều chất dinh dưỡng và vitamin rất tốt cho cơ thể. Ngoài ra, dưa leo còn có thể dụng để làm đẹp cũng rất hiệu quả.</div>', 'Dưa leo (1kg)', '', 'publish', 'open', 'closed', '', 'dua-leo', '', '', '2021-12-22 16:11:14', '2021-12-22 09:11:14', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=35', 0, 'product', '', 0),
