(37, 1, '2021-11-09 11:17:38', '2021-11-09 04:17:38', '<div>\r\n<div class="rich-text">\r\n\r\n<strong>Khoai tây</strong> là một loại thực phẩm giàu carb, cung cấp các loại vitamin, khoáng chất và các hợp chất thực vật tốt cho sức khỏe. Hơn thế nữa, chúng còn có tác dụng hỗ trợ giảm cân và ngăn ngừa bệnh tim hiệu quả.\r\n\r\n</div>\r\n</div>', 'Khoai tây (1kg)', '', 'publish', 'open', 'closed', '', 'khoai-tay', '', '', '2021-12-22 16:10:37', '2021-12-22 09:10:37', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=37', 0, 'product', '', 0),
