(39, 1, '2021-11-09 11:28:44', '2021-11-09 04:28:44', '<p class="sapo"><strong>Khổ qua</strong> hay còn gọi là mướp đắng, là loài cây có quả ăn được và vị của nó thuộc loại đắng nhất trong các loại rau quả. Khổ qua là loại rau củ có tác dụng giải cảm, tăng cường sức đề kháng, an thần, giảm mỡ máu... Đặc biệt, công dụng điều trị đái tháo đường (ĐTĐ) của nó ngày càng được chứng minh.</p>', 'Khổ qua(1kg)', '', 'publish', 'open', 'closed', '', 'kho-qua', '', '', '2021-12-22 16:10:21', '2021-12-22 09:10:21', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=39', 0, 'product', '', 0),
