(42, 1, '2021-11-09 11:31:02', '2021-11-09 04:31:02', '<strong>Mồng tơi</strong> không chỉ là một món ăn mà còn có tác dụng nhiều trong việc chữa bệnh. Mồng tơi mát và mùa nè nóng nực nó được xem như thứ rau vua. Trong Đông y, mồng tơi có tính hàn, vị chua, không độc, đi vào 5 kinh tâm, tì, can, đại trường, tá tràng, giúp lợi tiểu, tán nhiệt, giải độc, làm đẹp da, trị rôm sảy, mụn nhọt.', 'Mồng tơi (1kg)', '', 'publish', 'open', 'closed', '', 'mong-toi', '', '', '2021-12-22 16:10:12', '2021-12-22 09:10:12', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=42', 0, 'product', '', 0),
