(84, 1, '2021-11-09 13:23:33', '2021-11-09 06:23:33', '<strong>Ba rọi heo rút sườn</strong> là phần thịt đặc trưng bao gồm phần thịt ba rọi và sườn non đã được lấy xương. Ba rọi rút sườn chỉ lấy đoạn có phần sườn đã rút xương.', 'Ba rọi sườn heo (1kg)', '', 'publish', 'open', 'closed', '', 'ba-roi-suon-heo', '', '', '2021-12-27 22:26:01', '2021-12-27 15:26:01', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=84', 0, 'product', '', 1),
