(88, 1, '2021-11-09 13:48:36', '2021-11-09 06:48:36', '<strong>Thịt cốt lết</strong> là phần thịt ngon và đắt nhất nằm ở lưng heo. Từ thịt cốt lết có thể chế biến được nhiều món ăn hấp dẫn và đa dạng.', 'Cốt lết heo (1kg)', '', 'publish', 'open', 'closed', '', 'cot-let-heo', '', '', '2021-12-22 16:08:21', '2021-12-22 09:08:21', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=88', 0, 'product', '', 0),
