(95, 1, '2021-11-09 15:06:03', '2021-11-09 08:06:03', '<strong>Sườn già</strong> là phần sườn có xương to, cứng, ít thịt, khi nấu cần thời gian lâu, thịt dai, thích hợp làm các món canh hầm. Một miếng sườn tươi ngon sẽ có màu hồng nhạt, miếng sườn có xương dẹp và nhỏ. Những miếng sườn như vậy thì xương ít và nhiều thịt hơn loại sườn có xương to và tròn.', 'Sườn già heo (1kg)', '', 'publish', 'open', 'closed', '', 'suon-gia-heo', '', '', '2021-12-22 16:07:06', '2021-12-22 09:07:06', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=95', 0, 'product', '', 0),
