(97, 1, '2021-11-09 15:07:16', '2021-11-09 08:07:16', '<strong>Sườn non heo</strong> là phần sườn non được tính từ xương sườn số 5 trở về sau, là phần thịt đặc trưng có nạc, xương sườn, ít mỡ, được lấy từ phần bụng của heo. Có tỉ lệ nạc mỡ vừa đủ nên rất phù hợp để chế biến thành nhiều món ăn ngon cho gia đình.', 'Sườn non heo (1kg)', '', 'publish', 'open', 'closed', '', 'suon-non-heo', '', '', '2021-12-22 16:06:06', '2021-12-22 09:06:06', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=97', 0, 'product', '', 0),
