(100, 1, '2021-11-09 15:12:42', '2021-11-09 08:12:42', '<strong>Tên sản phẩm: Cánh gà</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Cánh gà</strong> tươi ngon mọng nước ai cũng ghiền là đây. Cánh được pha lóc từ những con gà thịt đạt chuẩn, trọng lượng đều nhau. Một kí khoảng 9-10 cái cánh gà tùy trọng lượng từng cánh.', 'Cánh gà (1kg)', '', 'publish', 'open', 'closed', '', 'canh-ga', '', '', '2021-12-22 16:01:47', '2021-12-22 09:01:47', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=100', 0, 'product', '', 0),
