(102, 1, '2021-11-09 15:13:38', '2021-11-09 08:13:38', '<strong>Tên sản phẩm: Đùi gà</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Đùi gà hay đùi tỏi gà</strong> là phần thịt đùi trên đầu gối và dưới mông gà. Có thể nói đây là bộ phận ngon nhất của con gà, vì được hoạt động nhiều nên thịt chắc và ngon.', 'Đùi gà (1kg)', '', 'publish', 'open', 'closed', '', 'dui-ga', '', '', '2021-12-22 16:01:33', '2021-12-22 09:01:33', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=102', 0, 'product', '', 0),
(103, 1, '2021-11-09 15:13:29', '2021-11-09 15:13:29', '', 'Đùi gà', '', 'inherit', 'open', 'closed', '', 'dui-ga', '', '', '2021-11-09 15:13:29', '2021-11-09 15:13:29', '', 102, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Dui-ga.jpg', 0, 'attachment', 'image/jpeg', 0),
(104, 1, '2021-11-09 15:14:35', '2021-11-09 08:14:35', '<strong>Tên sản phẩm: Đùi gà góc tư</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Đùi gà góc tư </strong>là 1/4 con gà ờ phần đùi gồm má gà và đùi tỏi. Phần thịt này được xem là  ngon và hấp dẫn khi chế biến các món ăn.', 'Đùi gà góc tư (0.5kg)', '', 'publish', 'open', 'closed', '', 'dui-ga-goc-tu', '', '', '2021-12-29 09:07:58', '2021-12-29 02:07:58', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=104', 0, 'product', '', 0),
(105, 1, '2021-11-09 15:14:28', '2021-11-09 15:14:28', '', 'Đùi gà góc tư', '', 'inherit', 'open', 'closed', '', 'dui-ga-goc-tu', '', '', '2021-11-09 15:14:28', '2021-11-09 15:14:28', '', 104, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Dui-ga-goc-tu.jpeg', 0, 'attachment', 'image/jpeg', 0),
(107, 1, '2021-11-09 15:15:48', '2021-11-09 08:15:48', '<strong>Tên sản phẩm: Má đùi gà</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Má đùi gà </strong>có lẽ không còn xa lạ với nhiều người tiêu dùng Việt. Đây là phần thịt nạc, có đủ độ dai, không có nhiều xương như chân hay đùi hoặc cánh. Má đùi gà từ lâu đã là một trong những loại thịt bán chạy nhất trong số các phần thịt gà nói chung. Với độ nạc, ngon, có da mà không ngấy, hơn nữa giá trị dinh dưỡng trong sản phẩm tương đối cao chính là lý do khiến má đùi gà trở thành sản phẩm quen thuộc trong mỗi bữa ăn của người Việt.', 'Má đùi gà (0.5kg)', '', 'publish', 'open', 'closed', '', 'ma-dui-ga', '', '', '2021-12-22 16:00:32', '2021-12-22 09:00:32', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=107', 0, 'product', '', 0),
