(112, 1, '2021-11-09 15:20:03', '2021-11-09 08:20:03', '<strong>Tên sản phẩm: Ức vịt</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Ức vịt tươi</strong> được lấy từ nguồn thịt sạch và tươi ngon, sản xuất theo công nghệ hiện đại từ khâu lựa chọn sản phẩm đển khâu chế biến để đảm bảo chất lượng và an toàn thực phẩm cho người tiêu dùng. Thịt vịt cung cấp một lượng lớn protein, vitamin A, vitamin D. Theo Đông y, thịt vịt có vị ngọt, hơi mặn, tính hàn, tác dụng tư âm, dưỡng vị, lợi thủy tiêu thũng, giải độc. Ăn thịt vịt có tác dụng tốt trong việc hỗ trợ chữa bệnh tim mạch, hỗ trợ điều trị lao phổi và ung thư.', 'Ức vịt (0.5kg)', '', 'publish', 'open', 'closed', '', 'uc-vit', '', '', '2021-12-22 15:59:24', '2021-12-22 08:59:24', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=112', 0, 'product', '', 0),
