(114, 1, '2021-11-09 15:21:25', '2021-11-09 08:21:25', '<strong>Tên sản phẩm : Vịt nguyên con</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Vịt nguyên con</strong> thường có khối lượng tối thiểu 1,9 kg trở lên; tuổi giết thịt 49-50 ngày tuổi và không quá 75 ngày tuổi.', 'Vịt nguyên con', '', 'publish', 'open', 'closed', '', 'vit-nguyen-con', '', '', '2021-12-22 15:59:35', '2021-12-22 08:59:35', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=114', 0, 'product', '', 0),
