(116, 1, '2021-11-09 15:26:06', '2021-11-09 08:26:06', '<strong>Tên sản phẩm: Ba chỉ bò Mỹ</strong>\r\n\r\n<strong>Xuất xứ: Mỹ</strong>\r\n\r\n<strong>Ba chỉ bò </strong>là phần thịt được lấy từ phần bụng của con bò, là phần thịt với những dải thịt nạc và thịt mỡ xen kẽ nhau tạo nên độ mềm, ngậy, ngọt nhưng hoàn toàn không ngấy.', 'Ba chỉ bò Mỹ (1kg)', '', 'publish', 'open', 'closed', '', 'ba-chi-bo', '', '', '2021-12-22 15:55:04', '2021-12-22 08:55:04', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=116', 0, 'product', '', 0),
