(119, 1, '2021-11-09 15:30:14', '2021-11-09 15:30:14', '<strong>Tên sản phẩm: Bắp hoa bò</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Bắp hoa bò</strong> là phần ngon nhất của con bò, nằm ở bắp chân. 1 con có khoảng 2-3 cái bắp hoa. Nên bắp hoa cực kỳ hiếm, nhưng ăn thì rất ngon bởi bắp hoa ăn giòn giòn, sực sực và có độ ngọt. Thịt và gân bắp đan xen vào nhau, ăn nhiều mà cũng không bị ngán.', 'Bắp hoa bò (1kg)', '', 'publish', 'open', 'closed', '', 'bap-hoa-bo', '', '', '2021-12-22 15:53:54', '2021-12-22 08:53:54', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=119', 0, 'product', '', 0),
