(121, 1, '2021-11-09 15:31:14', '2021-11-09 08:31:14', '<strong>Tên sản phẩm: Bít tết bò</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Bít tết</strong> là một món ăn bao gồm miếng thịt bò lát phẳng, thường được nướng vỉ, áp chảo hoặc nướng broiling ở nhiệt độ cao. Những miếng thịt mềm hơn được cắt ra từ phần thăn và sườn được làm chín nhanh chóng, sử dụng nhiệt khô và phục vụ toàn bộ.', 'Bít tết bò (1kg)', '', 'publish', 'open', 'closed', '', 'bit-tet-bo', '', '', '2021-12-28 22:48:55', '2021-12-28 15:48:55', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=121', 0, 'product', '', 0),
