(123, 1, '2021-11-09 15:32:43', '2021-11-09 08:32:43', '<strong>Tên sản phẩm: Dẻ sườn bò Mỹ</strong>\r\n\r\n<strong>Xuất xứ: Mỹ</strong>\r\n\r\n<strong>Dẻ sườn bò</strong> là phần thịt ở ức con bò, được pha lóc từ phần sườn trước. Đặc trưng của dẻ sườn là hương thơm cùng vị béo ngậy bởi những lớp mỡ dày trải dọc dẻ sườn, rất phù hợp để làm các món hầm, kho, sốt vang, nướng.', 'Dẻ sườn bò Mỹ (1kg)', '', 'publish', 'open', 'closed', '', 'de-suon-bo', '', '', '2021-12-22 15:46:56', '2021-12-22 08:46:56', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=123', 0, 'product', '', 0),
