(125, 1, '2021-11-09 15:53:42', '2021-11-09 08:53:42', '<strong>Tên sản phẩm: Gầu bò</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Thịt gầu bò</strong> là phần thịt được nằm ở gần ức và kéo dài từ ngực xuống dưới cổ bò, đây là phần hoạt động nhiều của bò, xen kẽ khá nhiều lớp gân, có cả nạc và mỡ xen lẫn nhưng không đều và không nhiều mỡ như phần thịt ba chỉ.\r\n\r\nGầu bò khi ăn rất giòn, ăn sẽ cảm thấy sần sật rất ngon. Có thể khi bạn nhìn vào miếng thịt gầu có lớp mỡ béo ngậy, trông rất ngán, nhưng loại mỡ này rất đặc biệt, sau khi chế biến sẽ cực kì giòn ăn rất đã miệng. Phần mỡ ở đây có tác dụng giữ thân nhiệt cho cổ bò nên mỡ trắng, béo nhưng không ngấy.', 'Gầu bò (1kg)', '', 'publish', 'open', 'closed', '', 'gau-bo', '', '', '2021-12-22 15:35:13', '2021-12-22 08:35:13', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=125', 0, 'product', '', 0),
(126, 1, '2021-11-09 15:38:12', '2021-11-09 15:38:12', '', 'Gầu bò', '', 'inherit', 'open', 'closed', '', 'gau-bo', '', '', '2021-11-09 15:38:12', '2021-11-09 15:38:12', '', 125, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Gau-bo.jpg', 0, 'attachment', 'image/jpeg', 0),
(128, 1, '2021-11-09 16:06:19', '2021-11-09 09:06:19', '<strong>Tên sản phẩm: Sườn bò Mỹ</strong>\r\n\r\n<strong>Xuất xứ: Mỹ</strong>\r\n\r\n<strong>Sườn bò</strong> là phần được cắt xẻ từ dẻ xương sườn trước của con bò. Phần xương sườn có dính nhiều thịt vẫn đảm bảo độ béo ngậy và hương vị đặc trưng của thịt bò. Sườn bò khác biệt so với các phần xương dính thịt khác, bởi sườn có nhiều thịt nạc, mỡ phân bố đều. Đồng thời, phần xương sườn có nhiều sụn, khi ăn mang lại cảm giác sần sật được nhiều người yêu thích.', 'Sườn bò Mỹ (1kg)', '', 'publish', 'open', 'closed', '', 'suon-bo', '', '', '2021-12-22 15:34:52', '2021-12-22 08:34:52', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=128', 0, 'product', '', 1),
(129, 1, '2021-11-09 16:06:13', '2021-11-09 16:06:13', '', 'Sườn bò', '', 'inherit', 'open', 'closed', '', 'suon-bo', '', '', '2021-11-09 16:06:13', '2021-11-09 16:06:13', '', 128, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Suon-bo.png', 0, 'attachment', 'image/png', 0),
(130, 1, '2021-11-09 16:07:16', '2021-11-09 09:07:16', '<strong>Tên sản phẩm: Thăn phi lê bò</strong>\r\n\r\n<strong>Xuất xứ: Việt Nam</strong>\r\n\r\n<strong>Thịt bò phi lê</strong> hay còn được nhiều người gọi là thịt thăn là phần thịt được cắt ra từ phần lưng phía trong của con bò. Phần thịt này được biết đến là phần thịt ngon và mềm nhất của con bò được rất nhiều người ưa thích.\r\n\r\nLà phần thịt thuộc nhóm ngon nhất của thịt bò, bạn có thể thoải mái chế biến phần thịt bò phi lê thành nhiều món ăn khác nhau. Từ món bít tết cho đến món hấp, sốt đều được tuy nhiên do thịt thăn có đặc điểm mềm hơn các phần thịt khác vì vậy cách chế biến thịt thăn ngon nhất vẫn là món nướng.\r\n\r\n&nbsp;', 'Thăn phi lê bò (1kg)', '', 'publish', 'open', 'closed', '', 'than-file-bo', '', '', '2021-12-22 15:26:22', '2021-12-22 08:26:22', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=130', 0, 'product', '', 0),
(131, 1, '2021-11-09 16:07:08', '2021-11-09 16:07:08', '', 'Thăn file bò', '', 'inherit', 'open', 'closed', '', 'than-file-bo', '', '', '2021-11-09 16:07:08', '2021-11-09 16:07:08', '', 130, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Than-file-bo.jpg', 0, 'attachment', 'image/jpeg', 0),
(132, 1, '2021-11-09 16:14:20', '2021-11-09 16:14:20', '<strong>Tên sản phẩm: Thăn vai bò </strong><strong>Mỹ</strong>\r\n\r\n<strong>Xuất xứ: Mỹ</strong>\r\n\r\n<strong>Thăn vai bò Mỹ </strong>hay còn được gọi là lóc thăn vai. Đây là phần thịt được lọc từ phần nạc vai trên lưng của con bò. Đồng thời là phần thịt giữa xương sườn số 5 và số 6. Vì vậy thit vai bò chủ yếu là phần thịt nạc. Trong thịt có lẫn chút mỡ bao bọc bên ngoài. Thăn vai thịt bò Mỹ càng không lẫn sụn cũng như không lẫn xương sườn hay nhiều gân như các loại thịt khác.', 'Thăn vai bò Mỹ (1kg)', '', 'publish', 'open', 'closed', '', 'than-vai-bo', '', '', '2021-12-26 01:40:36', '2021-12-25 18:40:36', '', 0, 'http://www.thucphamgiasimienque.com/?post_type=product&#038;p=132', 0, 'product', '', 0),
(133, 1, '2021-11-09 16:13:59', '2021-11-09 16:13:59', '', 'Fresh Raw Beef Steak Ribeye, with salt, peppercorns, rosemary, tomatoes and olive oil', 'Fresh Raw Beef Steak Ribeye, with salt, peppercorns, rosemary, tomatoes and olive oil.', 'inherit', 'open', 'closed', '', 'fresh-raw-beef-steak-ribeye-with-salt-peppercorns-rosemary-tomatoes-and-olive-oil', '', '', '2021-11-09 16:13:59', '2021-11-09 16:13:59', '', 132, 'http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/Than-vai-bo.jpeg', 0, 'attachment', 'image/jpeg', 0);
