(312, 1, '2021-12-06 00:57:58', '2021-12-05 17:57:58', '<!-- wp:cover {"url":"http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/21-2.jpg","id":168,"overlayColor":"white"} -->\n<div class="wp-block-cover has-white-background-color has-background-dim"><img class="wp-block-cover__image-background wp-image-168" alt="" src="http://www.thucphamgiasimienque.com/wp-content/uploads/2021/11/21-2.jpg" data-object-fit="cover"/><div class="wp-block-cover__inner-container"><!-- wp:paragraph {"align":"center","textColor":"light-green-cyan","fontSize":"large"} -->\n<p class="has-text-align-center has-light-green-cyan-color has-text-color has-large-font-size"><strong>Welcome to my shop</strong></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->', 'Welcome to my shop', '', 'inherit', 'closed', 'closed', '', '172-revision-v1', '', '', '2021-12-06 00:57:58', '2021-12-05 17:57:58', '', 172, 'http://www.thucphamgiasimienque.com/?p=312', 0, 'revision', '', 0),
(313, 1, '2021-12-26 01:40:30', '2021-12-25 18:40:30', '<strong>Tên sản phẩm: Thăn vai bò </strong><strong>Mỹ</strong>\n\n<strong>Xuất xứ: Mỹ</strong>\n\n<strong>Thăn vai bò Mỹ </strong>hay còn được gọi là lóc thăn vai. Đây là phần thịt được lọc từ phần nạc vai trên lưng của con bò. Đồng thời là phần thịt giữa xương sườn số 5 và số 6. Vì vậy thit vai bò chủ yếu là phần thịt nạc. Trong thịt có lẫn chút mỡ bao bọc bên ngoài. Thăn vai thịt bò Mỹ càng không lẫn sụn cũng như không lẫn xương sườn hay nhiều gân như các loại thịt khác.', 'Thăn vai bò Mỹ (1kg)', '', 'inherit', 'closed', 'closed', '', '132-autosave-v1', '', '', '2021-12-26 01:40:30', '2021-12-25 18:40:30', '', 132, 'http://www.thucphamgiasimienque.com/?p=313', 0, 'revision', '', 0),
(314, 1, '2021-12-06 01:22:36', '2021-12-05 18:22:36', '<strong>Tên sản phẩm: Thăn phi lê bò</strong>\n\n<strong>Xuất xứ: Việt Nam</strong>\n\n<strong>Thịt bò phi lê</strong> hay còn được nhiều người gọi là thịt thăn là phần thịt được cắt ra từ phần lưng phía trong của con bò. Phần thịt này được biết đến là phần thịt ngon và mềm nhất của con bò được rất nhiều người ưa thích.\n\n&nbsp;', 'Thăn phi lê bò', '', 'inherit', 'closed', 'closed', '', '130-autosave-v1', '', '', '2021-12-06 01:22:36', '2021-12-05 18:22:36', '', 130, 'http://www.thucphamgiasimienque.com/?p=314', 0, 'revision', '', 0),
