(324, 1, '2021-12-06 15:52:12', '2021-12-06 08:52:12', 'Trong 1 quả trứng vịt (khoảng 70gr) có chứa 130 <strong>calo </strong>và những thành phần dinh dưỡng như:\n<ul>\n 	<li>Chất đạm: 18% DV (Giá trị dinh dưỡng hằng ngày)</li>\n 	<li>Cholesterol: 295% DV</li>\n 	<li>Chất béo: 14gr</li>\n 	<li>Vitamin A: 9% DV</li>\n 	<li>Vitamin B1: 7% DV</li>\n 	<li>Vitamin B2: 17% DV</li>\n 	<li>Vitamin B5: 13% DV</li>\n 	<li>Vitamin B9: 14% DV</li>\n 	<li>Vitamin B12: 63% DV</li>\n 	<li><a title="Vitamin E" href="https://www.dienmayxanh.com/vao-bep/9-tac-dung-cua-vitamin-e-cach-su-dung-va-cac-thuc-pham-giau-05234" target="_blank" rel="noopener">Vitamin E</a>: 5% DV</li>\n</ul>\nNgoài ra, trứng vịt còn cung cấp các loại khoáng chất dồi dào và phong phú như: Sắt, kẽm, choline, photpho,...\n\n<a title="Nguồn tham khảo từ bài viết Trứng vịt có tác dụng gì? Ăn nhiều trứng vịt có tốt không? khám phá ngay trên trang NGONAZ" href="https://ngonaz.com/trung-vit-co-tac-dung-gi/"><img src="https://ngonaz.com/wp-content/uploads/2021/10/ngonaz-1.jpg" /></a>', 'Trứng vịt', '', 'inherit', 'closed', 'closed', '', '19-autosave-v1', '', '', '2021-12-06 15:52:12', '2021-12-06 08:52:12', '', 19, 'http://www.thucphamgiasimienque.com/?p=324', 0, 'revision', '', 0),
(325, 1, '2021-12-06 20:11:58', '2021-12-06 13:11:58', 'Sườn non heo là phần sườn non được tính từ xương sườn số 5 trở về sau, là phần thịt đặc trưng có nạc, xương sườn, ít mỡ, được lấy từ phần bụng của heo.', 'Sườn non heo', '', 'inherit', 'closed', 'closed', '', '97-autosave-v1', '', '', '2021-12-06 20:11:58', '2021-12-06 13:11:58', '', 97, 'http://www.thucphamgiasimienque.com/?p=325', 0, 'revision', '', 0),
