(330, 1, '2021-12-06 22:12:21', '2021-12-06 15:12:21', '<p class="sapo"><strong>Khổ qua</strong> hay còn gọi là mướp đắng, là loài cây có quả ăn được và vị của nó thuộc loại đắng nhất trong các loại rau quả. Khổ qua là loại rau củ có tác dụng giải cảm, tăng cường sức đề kháng, an thần, giảm mỡ máu... Đặc biệt, công dụng điều trị đái tháo đường (ĐTĐ) của nó ngày càng được chứng minh.</p>', 'Khổ qua', '', 'inherit', 'closed', 'closed', '', '39-autosave-v1', '', '', '2021-12-06 22:12:21', '2021-12-06 15:12:21', '', 39, 'http://www.thucphamgiasimienque.com/?p=330', 0, 'revision', '', 0),
(331, 1, '2021-12-06 22:19:21', '2021-12-06 15:19:21', '<div>\n<div class="rich-text">\n\n<strong>Khoai tây</strong> là một loại thực phẩm giàu carb, cung cấp các loại vitamin, khoáng chất và các hợp chất thực vật tốt cho sức khỏe. Hơn thế nữa, chúng còn có tác dụng hỗ trợ giảm cân và ngăn ngừa bệnh tim hiệu quả.\n\n</div>\n</div>', 'Khoai tây', '', 'inherit', 'closed', 'closed', '', '37-autosave-v1', '', '', '2021-12-06 22:19:21', '2021-12-06 15:19:21', '', 37, 'http://www.thucphamgiasimienque.com/?p=331', 0, 'revision', '', 0),
(332, 1, '2021-12-06 22:26:13', '2021-12-06 15:26:13', 'Cải thảo có nguồn gốc từ Trung Quốc, còn gọi là cải bao, cải cuốn, cải bắp tây, là một loài thuộc họ Cải rất được yêu thích và được chế biến thành vô số những món xào, món canh và nhúng trong các <a title="món lẩu" href="https://www.dienmayxanh.com/vao-bep/mon-lau" target="_blank" rel="noopener">món lẩu</a> vô cùng thơm ngon.\n\nCải thảo có màu sắc khá giống với bắp cải, phần lá bao ngoài của màu xanh đậm, còn lá cuộn ở bên trong (gọi là lá non) có màu xanh nhạt, trong khi phần cuống lá có màu trắng.', 'Cải thảo', '', 'inherit', 'closed', 'closed', '', '33-autosave-v1', '', '', '2021-12-06 22:26:13', '2021-12-06 15:26:13', '', 33, 'http://www.thucphamgiasimienque.com/?p=332', 0, 'revision', '', 0),
