(36, 'bbpos-chipper-launch', 'marketing', 'en_US', 'Ready to grow your business beyond online?', 'Collect payment in person for orders placed online using WooCommerce In-Person Payments. The BBPOS Chipper card reader can process payments securely, and keep everything synced in your WooCommerce Payments dashboard – no matter where you are.', '{}', 'pending', 'woocommerce.com', '2021-11-09 09:38:45', NULL, 0, 'plain', '', 0, 'info'),
