(48, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2021-11-11 09:48:03', NULL, 0, 'plain', '', 0, 'info'),
(49, 'wc-admin-personalize-store', 'info', 'en_US', 'Personalize your store''s homepage', 'The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don''t forget to personalize the homepage that we created for your store during the onboarding.', '{}', 'unactioned', 'woocommerce-admin', '2021-11-11 09:48:03', NULL, 0, 'plain', '', 0, 'info'),
(50, 'wc-admin-online-clothing-store', 'info', 'en_US', 'Start your online clothing store', 'Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we''ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.', '{}', 'unactioned', 'woocommerce-admin', '2021-11-11 09:48:03', NULL, 0, 'plain', '', 0, 'info'),
