(61, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Help WooCommerce improve with usage tracking', 'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href="http://www.thucphamgiasimienque.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com" target="_blank">Settings</a> and choose to stop sharing data. <a href="https://woocommerce.com/usage-tracking?utm_medium=product" target="_blank">Read more</a> about what data we collect.', '{}', 'unactioned', 'woocommerce-admin', '2021-11-16 09:48:23', NULL, 0, 'plain', '', 0, 'info'),
(62, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Did you know?', 'A WooCommerce powered store needs on average 31 days to get the first sale. You''re on the right track! Do you find this type of insight useful?', '{}', 'unactioned', 'woocommerce-admin', '2021-11-16 09:48:23', NULL, 0, 'plain', '', 0, 'info'),
